import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';
import { AppComponent } from './app.component';
import { SidebarComponent } from './sidebar/sidebar.component';  // SidebarComponent
import { CommonModule } from '@angular/common';  // Import CommonModule

@NgModule({
  declarations: [
    AppComponent,
    SidebarComponent  // Make sure SidebarComponent is declared here
  ],
  imports: [
    BrowserModule,
    CommonModule  // Add CommonModule here to use *ngIf, *ngFor, etc.
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
